    TestImage::TestImage() :
        m_p_acq_param(nullptr),
        m_p_roi(nullptr),
        m_img_count(static_cast<unsigned int>(M_S_TEST_IMAGES.size())),
        m_angle_deg(0.0),
        m_img_index(0) {
        update_image();
    }

    TestImage::TestImage(const AcquisitionParameters *p_ap, const RegionOfInterest *p_roi) :
        m_p_acq_param(p_ap),
        m_p_roi(p_roi),
        m_img_count(360),
        m_angle_deg(0.0),
        m_img_index(0) {
        update_image();
    }

    // public member functions
    const unsigned char *TestImage::get_image_buffer() {
        return static_cast<const TestImage *>(this)->get_image_buffer();
    }

    const unsigned char *TestImage::get_image_buffer() const {
        update_image();
        return m_current_img.data();
    }

    unsigned TestImage::get_number_of_components() const {
        return M_S_COMPONENT_COUNT;
    }

    std::string TestImage::get_component_name(unsigned component) const {
        switch (component) {
            case 0:
                return "red";
            case 1:
                return "green";
            case 2:
                return "blue";
            case 3:
                return "alpha";
            default:
                assert(false);
                return "NULL";
        }
    }

    long TestImage::get_image_buffer_size() const {
        return static_cast<long>(get_image_width())
            * static_cast<long>(get_image_height())
            * static_cast<long>(get_image_bytes_per_pixel());
    }

    unsigned TestImage::get_image_width() const {
        return m_p_roi->w();
    }

    unsigned TestImage::get_image_height() const {
        return m_p_roi->h();
    }

    unsigned TestImage::get_image_bytes_per_pixel() const {
        auto bytes_per_component = ((get_bit_depth() - 1) / 8) + 1;
        return bytes_per_component * get_number_of_components();
    }

    unsigned TestImage::get_bit_depth() const {
        return M_S_BIT_DEPTH;
    }

    double TestImage::get_pixel_size_um() const {
        return 1.0;
    }

    unsigned int TestImage::width() {
        return M_S_SIZE[0];
    }

    unsigned int TestImage::height() {
        return M_S_SIZE[1];
    }

    // private member functions
    void TestImage::update_image() const {
        auto exposure_time_ms = static_cast<long long>(m_p_acq_param->get_exposure_ms());

        auto now = std::chrono::system_clock::now();
        auto until = now + std::chrono::milliseconds(exposure_time_ms);

        if (m_p_acq_param == nullptr) {
            assert(m_img_index < M_S_TEST_IMAGES.size());
            m_current_img = img{M_S_TEST_IMAGES.at(m_img_index)};
        }
        else {
            assert(m_p_acq_param != nullptr);
            assert(m_p_roi != nullptr);

            m_current_img = img(get_image_buffer_size(), 0);

            // setup ROI
            unsigned int START_Y = m_p_roi->y();
            unsigned int STOP_Y = m_p_roi->y_end();
            unsigned int START_X = m_p_roi->x();
            unsigned int STOP_X = m_p_roi->x_end();
            unsigned int START_C = 0;
            unsigned int STOP_C = get_number_of_components();

            int WINDOW_SIZE = static_cast<int>(m_p_acq_param->get_binning());

            // generate base HSL image ROI
            img base_image(get_base_buffer_size(), 0);
            auto W = static_cast<double>(width());
            auto H = static_cast<double>(height());
            std::array<double, 2> center{W / 2.0, H / 2.0};
            double X_MAX = W + 1.0 - center[0];
            double Y_MAX = H + 1.0 - center[1];
            double SIDE_MAX = std::min(X_MAX, Y_MAX);
            double R2_MAX = SIDE_MAX * SIDE_MAX;
            double PI = 3.14159265358979323846;
            double RAD_TO_DEG = 180.0 / PI;
            double L = 0.5;

            int EXCESS_SIZE = WINDOW_SIZE - 1;
            int PRE_SIZE = EXCESS_SIZE / 2;
            int POST_SIZE = EXCESS_SIZE / 2 + EXCESS_SIZE % 2 + 1;

            for (unsigned int y = START_Y; y < STOP_Y; ++y) {
                auto Y = static_cast<double>(y) - center[1];
                auto Y2 = Y * Y;
                for (unsigned int x = START_X; x < STOP_X; ++x) {
                    auto X = static_cast<double>(x) - center[0];
                    auto X2 = X * X;

                    double R2 = X2 + Y2;
                    double H_rad = std::atan2(Y, X) + PI;
                    double H_deg = std::fmod(H_rad * RAD_TO_DEG + m_angle_deg, 360.0);
                    double S = 1.0 - (R2_MAX - R2) / R2_MAX;

                    double a = S * std::min(L, 1 - L);
                    auto calc_rgb = [L, a, H_deg](double n) {return compute_f(L, a, compute_k(H_deg, n)); };
                    auto R = to_uchar_color(calc_rgb(0.0));
                    auto G = to_uchar_color(calc_rgb(8.0));
                    auto B = to_uchar_color(calc_rgb(4.0));
                    auto A = to_uchar_color(0.0);
                    std::array<unsigned char, M_S_COMPONENT_COUNT> values{R, G, B, A};
                    for (unsigned int c = START_C; c < STOP_C; ++c) {
                        unsigned int ind = to_ind(c, x, y);
                        base_image[ind] = values[c];
                    }
                }
            }

            // bin the HSL image ROI
            unsigned int ind = 0;
            for (unsigned int y = START_Y; y < STOP_Y; ++y) {
                for (unsigned int x = START_X; x < STOP_X; ++x) {
                    unsigned int START_J = std::max(static_cast<int>(START_Y), static_cast<int>(y) - PRE_SIZE);
                    unsigned int STOP_J = std::min(static_cast<int>(STOP_Y), static_cast<int>(y) + POST_SIZE);
                    unsigned int START_I = std::max(static_cast<int>(START_X), static_cast<int>(x) - PRE_SIZE);
                    unsigned int STOP_I = std::min(static_cast<int>(STOP_X), static_cast<int>(x) + POST_SIZE);
                    unsigned int bin_count = 0;
                    std::array<double, M_S_COMPONENT_COUNT> values{0.0, 0.0, 0.0, 0.0};
                    for (unsigned int j = START_J; j < STOP_J; ++j) {
                        for (unsigned int i = START_I; i < STOP_I; ++i) {
                            for (unsigned int c = START_C; c < STOP_C; ++c) {
                                unsigned int base_ind = to_ind(c, i, j);
                                values[c] += to_double_color(base_image[base_ind]);
                            }
                            ++bin_count;
                        }
                    }
                    assert(0 < bin_count);
                    for (unsigned int c = START_C; c < STOP_C; ++c) {
                        //unsigned int ind = to_ind(c, x, y);
                        m_current_img[ind] = to_uchar_color(values[c] / bin_count);
                        ++ind;
                    }
                }
            }
        }

        // update index
        m_img_index = (m_img_index + 1) % m_img_count;

        // update angle
        double DEG_PER_MS = 360.0 / 5000.0;
        double angle_shift_deg_per_image = exposure_time_ms * DEG_PER_MS;
        m_angle_deg = std::fmod(m_angle_deg + angle_shift_deg_per_image, 360.0);

        std::this_thread::sleep_until(until);
    }

    long TestImage::get_base_buffer_size() const {
        return width() * height() * get_image_bytes_per_pixel();
    }

    long TestImage::to_ind(unsigned int c, unsigned int x, unsigned int y) const {
        return static_cast<long>(c)
            + static_cast<long>(x) * get_number_of_components()
            + static_cast<long>(y) * width() * get_number_of_components();
    }

    double TestImage::to_double_color(unsigned char value) {
        return value / 255.0;
    }

    unsigned char TestImage::to_uchar_color(double value) {
        value = value * 256.0;
        value = std::floor(value);
        value = std::max(value, 0.0);
        value = std::min(value, 255.0);
        return static_cast<unsigned char>(value);
    }

    double TestImage::compute_k(double H_deg, double n) {
        auto arg = n + (H_deg / 30.0);
        return std::fmod(arg, 12.0);
    }

    double TestImage::compute_f(double L, double a, double k) {
        auto min = std::min(k - 3.0, 9.0 - k);
        min = std::min(min, 1.0);
        auto max = std::max(-1.0, min);
        return L - a * max;
    }

